import Container from "react-bootstrap/esm/Container";


function Footer(){
    return(
        <footer>
            <Containerfluid>
                <div className="row text-center" style={"background: black; border-top: 2px solid white"}>
                    <a href="/">
                        <img src="./src/img/logo2.png" alt="logo da empresa" style={"width: 100px;"}/>
                    </a>
                </div>
            </Containerfluid>
      </footer>
    );
}

export default Footer;
